import React from 'react';
import {createStyles, makeStyles, Theme} from "@material-ui/core/styles";
import CssBaseline from "@material-ui/core/CssBaseline";
import Container from "@material-ui/core/Container";
import Typography from "@material-ui/core/Typography";

const useStyles = makeStyles((theme: Theme) =>
    createStyles({
        root: {
            backgroundColor:'white',
            backgroundSize:'1500px',
            display:'flex',
            height: theme.spacing(100),
            flexDirection:'row',
        },

        pageContainer: {
            marginTop: theme.spacing(5),
        },

        section1: {
            flexDirection:'column',
            filter:'blur(2px)'
        },

        section2: {

            color:'white',
            fontWeight:'bold',
            border:'3px solid #f1f1f1',
            position:'absolute',
            top:'40%',
            left:'25%',
            zIndex: theme.spacing(2),
            textAlign:'center',
            boxSizing:'border-box'

        },
    }),
);

const lightTheme = {
    body: '#E2E2E2',
    text: '#363537',
    toggleBorder: '#FFF',
    gradient: 'linear-gradient(#39598A, #79D7ED)',
}








export default function  LandingPage() {

    const classes = useStyles();

    return (
        <div className={classes.root}>
            <React.Fragment>
                <CssBaseline />
                <Container fixed className={classes.pageContainer}>
                    <div>
                        <div className = {classes.section1}></div>
                        <div className={classes.section2} style={{backgroundColor:'rgba(0,0,0, 0.4)'}}>
                            <h1 style={{fontSize: '80px'}}> Krunal Mistry</h1>
                        </div>
                    </div>
                    <Typography>

                    </Typography>
                </Container>
            </React.Fragment>
        </div>
    );
}
